import Contact from '../Contact/contact';
import Down from '../Ftr/down';
import Edu from '../Education/education'
import Navigation from './Navigation';
import Hire from '../HireMe/hireme'
import { Link} from 'react-router-dom';
const Body = () => {
  return (   
   
    <div className="navbar_body">
       <Navigation/>
      {/* Bodytext */}
      <section id="hm">
        
      <div className="container" >
        <div className="row">
          <div className="col-md-6">
            <div className="nametext" data-aos="fade-right">
            <h1 className="animate__animated animate__rotateInUpLeft hello" > Hello I`m </h1>
            <h1 className="rabin">Rabin Subedi</h1>
            <p> Web Designer</p>
               
                  <Link to="/hireme" className="btn btn-success hirebutton">Hire Me</Link>
      
            </div>
          </div>
          <div className="col-md-6">
            <img src={headimg} className="headimage" alt="logoimage"></img>
          </div>
        </div>
      </div>
     </section>

      <Service />
      <About />
      <Skill />
      <Contact />
      <Edu />
      <Down />
 
    </div>


  )
}
export default Body;
